/**
 * Professional Green Olive Palette
 */

export const palette = {
  mode: 'light',  // ← LIGHT mode, not dark!

  primary: {
    main: '#6B7B3F',        // Olive green
    light: '#8B9B5F',
    dark: '#4A5A2D',
    contrastText: '#FFFFFF',
  },

  secondary: {
    main: '#9CAF6B',
    light: '#B8C77D',
    dark: '#7A8F4F',
    contrastText: '#FFFFFF',
  },

  background: {
    default: '#F5F7F0',
    paper: '#FFFFFF',
  },

  text: {
    primary: '#2C3E1F',
    secondary: '#5A6B47',
    disabled: '#ADB5A3',
  },

  success: {
    main: '#6B7B3F',
    light: '#8B9B5F',
    dark: '#4A5A2D',
  },

  error: {
    main: '#C85A54',
    light: '#D87B76',
    dark: '#A84842',
  },

  warning: {
    main: '#D4A857',
    light: '#E4C179',
    dark: '#B89045',
  },

  info: {
    main: '#6B7B3F',
    light: '#8B9B5F',
    dark: '#4A5A2D',
  },

  divider: 'rgba(107, 123, 63, 0.12)',
};
